CREATE DATABASE IF NOT EXISTS cursosdb;
USE cursosdb;

DROP TABLE IF EXISTS `cursos`;
CREATE TABLE `cursos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombreCurso` varchar(80) DEFAULT NULL,
  `grupo` int(11) DEFAULT NULL,
  `profesor` varchar(50) DEFAULT NULL,
  `correoProfesor` varchar(50) DEFAULT NULL,
  `nombreEstudiante` varchar(50) DEFAULT NULL,
  `correoEstudiante` varchar(50) DEFAULT NULL,
  `nota` float DEFAULT NULL,
  `periodo` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20000 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


LOCK TABLES `cursos` WRITE;















































































































































































